import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';

const BodyCategories = () => {
    const categorias = [
        {
            id: 1,
            nome:'Pizza' , 
            produtos:[
                {id: 1, nome:'Broto'},
                {id: 2, nome:'Media'},
                {id: 3, nome:'Grande'},
        ]},
        {
            id: 2,
            nome:'Drinks' , 
            produtos:[
                {id: 1, nome:'Coca-Cola'},
                {id: 2, nome:'Sprite'},
                {id: 3, nome:'Fanta Uva'},
        ]}
    ]

    categorias.produtos.map((p, index) => (
        <Fragment>
            <b>{p}</b>
        </Fragment>
    ))

    return (
        <div class='MainProduct'>
            <div class='category'>
                <p class='foodTitle'>Pizzas</p>
            </div>
            <div class = 'category'>
               <p class='foodTitle'>Drinks</p>
            </div>
        </div>
    )
}

export default BodyCategories;
